import React, {useEffect ,useState} from "react";
import { Container, Row } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import s from "./Header.module.css";
import axios from "axios";

const Header = ({isLoggedIn, setIsLoggedIn}) => {
  const handleLogOut = () => {
    setIsLoggedIn(false);
  };

  const [stat, setStat] = useState("");

  useEffect(() => {

    axios
        .get("https://localhost:44312/api/Login/IsAdmin",{
            headers:{
                "Content-Type": "application/json",
                "Accept": "application/json",
                "Authorization": "Bearer "+ localStorage.getItem("tok"),
            }
        })
        .then(
            (respon) => {
                console.log(respon);
                console.log(respon.data);
                setStat(respon.data)})
  },[]);
  console.log(stat);

  function isAdmin(){
    
    if(localStorage.getItem("isAdminIn")==='true'){
      return (
      
        <NavLink
        className={`nav`}
        to="/services"
        activeClassName={s.active}
    >
      Панель
    </NavLink>
      )
    }
    
  }

  return (

    <header>
      {
        isLoggedIn ?
            <div className="header">
              <Container>
                <Row>
                  <ul>
                    


                    <li className={s.item}>
                      <NavLink
                          className={`nav`}
                          to="/cars"
                          activeClassName={s.active}
                      >
                        Машины
                      </NavLink>
                    </li>



                    <li className={s.item}>
                      {isAdmin}
    
                    </li> 
                    

                    <li className={s.item}>
                      <NavLink
                          className={`nav`}
                          to="/review"
                          activeClassName={s.active}
                      >
                        Отзывы
                      </NavLink>
                    </li>
                    <li className={s.item}>
                      <NavLink className={`logo me-3 nav`} to="/main">
                        Yotor
                      </NavLink>
                    </li>
                    
                    <li className={s.item}>
                      <NavLink
                          className={` ${s.btn_online}`}
                          to="/online"
                          activeClassName={s.active}
                      >
                        Записаться онлайн
                      </NavLink>
                    </li>
                    <li className={s.item}>
                      <NavLink
                          className={` ${s.btn_join}`}
                          to="/cabinet"
                          activeClassName={s.active}
                      >
                        Личный кабинет
                      </NavLink>
                    </li>
                  </ul>
                </Row>
              </Container>
            </div>

            :

            <div className="header">
              <Container>
                <Row>
                  <ul> 
                    <li className={s.item}>
                        
                    
                  
                
                  </li>
                      
                    <li className={s.item} >
                      <NavLink
                          className={`nav`}
                          to="/review"
                          activeClassName={s.active}
                      >
                        Отзывы
                      </NavLink>
                    </li>
                    <li className={s.item}>
                      <NavLink className={`logo me-3 nav`} to="/main">
                        Yotor
                      </NavLink>
                    </li>
                    
                    <li className={s.item}>
                      <NavLink
                          className={` ${s.btn_online}`}
                          to="/online"
                          activeClassName={s.active}
                      >
                        Забронировать
                      </NavLink>
                    </li>
                    <li className={s.item}>
                      <NavLink
                          className={` ${s.btn_join}`}
                          to="/login"
                          activeClassName={s.active}
                      >
                        Войти
                      </NavLink>
                    </li>
                  </ul>
                </Row>
              </Container>
            </div>
      }

    </header>
  );
};

export default Header;
